SEED = 'mimcsponge'
NROUNDS = 220
curve_order = (
    21888242871839275222246405745257275088548364400416034343698204186575808495617
    )


def __mimc_hash(xL_in: str, xR_in: str, k: str, cts: list) ->tuple:
    xL = int(xL_in)
    xR = int(xR_in)
    k = int(k)
    for i in range(NROUNDS):
        c = cts[i]
        t = __mimc_add(xL, k) if i == 0 else __mimc_add(__mimc_add(xL, k), c)
        xR_tmp = int(xR)
        if i < NROUNDS - 1:
            xR = xL
            xL = __mimc_add(xR_tmp, __mimc_exp(t, 5))
        else:
            xR = __mimc_add(xR_tmp, __mimc_exp(t, 5))
    return __mimc_affine(xL), __mimc_affine(xR)


def __mimc_multi_hash(arr: list, cts: list, key: str=None, num_outputs: int=1):
    key = int(key or 0)
    r = 0
    c = 0
    for i in range(len(arr)):
        r = __mimc_add(r, int(arr[i]))
        r, c = __mimc_hash(r, c, key, cts)
    outputs = [__mimc_affine(r)]
    for i in range(1, num_outputs):
        r, c = __mimc_hash(r, c, key)
        outputs.append(__mimc_affine(r))
    return outputs


def __hash_left_right(left: str, right: str, cts: list) ->str:
    assert int(left) < curve_order, 'left should be inside the field'
    assert int(right) < curve_order, 'right should be inside the field'
    return str(__mimc_multi_hash([left, right], cts)[0])


def __mimc_add(self: int, other: int) ->int:
    return (self + other) % curve_order


def __mimc_mul(self: int, other: int) ->int:
    return self * other % curve_order


def __mimc_square(self: int) ->int:
    return __mimc_mul(self, self)


def __mimc_shr(self: int, b: int) ->int:
    return self >> b


def __mimc_exp(base: int, e: int) ->int:
    res = 1
    rem = int(e)
    ex = base
    while rem != 0:
        if rem % 2 == 1:
            res = __mimc_mul(res, ex)
        ex = __mimc_square(ex)
        rem = __mimc_shr(rem, 1)
    return res


def __mimc_affine(self: int) ->int:
    aux = self
    nq = -curve_order
    if aux < 0:
        if aux <= nq:
            aux = aux % curve_order
        if aux < 0:
            aux = aux + curve_order
    elif aux >= curve_order:
        aux = aux % curve_order
    return aux


def __insert(leaf: str) ->int:
    current_index = __next_index.get()
    tree_levels = TREE_LEVELS
    assert current_index != 2 ** tree_levels, 'Merkle tree is full. No more leaves can be added.'
    cts = mimc_cts.get_cts()
    filled_subtrees = __filled_subtrees_var.get()
    roots = __roots_var.get()
    current_level_hash = str(leaf)
    for i in range(tree_levels):
        if current_index % 2 == 0:
            left = current_level_hash
            right = __zeros(i)
            filled_subtrees[i] = current_level_hash
        else:
            left = filled_subtrees[i]
            right = current_level_hash
        current_level_hash = __hash_left_right(left, right, cts)
        current_index /= 2
    root_index = __current_root_index.get()
    next_root_index = int((root_index + 1) % ROOT_HISTORY_SIZE)
    roots[next_root_index] = current_level_hash
    __next_index.set(int(current_index + 1))
    __current_root_index.set(next_root_index)
    __roots_var.set(roots)
    __filled_subtrees_var.set(filled_subtrees)
    return current_index


def __is_known_root(root: str) ->bool:
    if root is None or len(root) == 0 or int(root) == 0:
        return False
    i = __current_root_index.get()
    current_index = i
    roots = __roots_var.get()
    first_loop = True
    while first_loop or i != current_index:
        first_loop = False
        if root == roots[i]:
            return True
        if i == 0:
            i = ROOT_HISTORY_SIZE
        i -= 1
    return False


