def __force_leave(node: str):
    __pending_leave[node] = now + datetime.timedelta(days=7)


@__export('masternodes')
def announce_leave():
    assert ctx.caller in __nodes.get(), 'Not a node'
    assert __pending_leave[ctx.caller] == False, 'Already pending leave'
    __pending_leave[ctx.caller] = now + datetime.timedelta(days=7)


@__export('masternodes')
def leave():
    assert __pending_leave[ctx.caller], 'Not pending leave'
    assert __pending_leave[ctx.caller
        ] < now, 'Leave announcement period not over'
    if ctx.caller in __nodes.get():
        __nodes.set([node for node in __nodes.get() if node != ctx.caller])
    __pending_leave[ctx.caller] = False


@__export('masternodes')
def register():
    assert ctx.caller not in __nodes.get(), 'Already a node'
    assert __pending_registrations[ctx.caller
        ] == False, 'Already pending registration'
    currency.transfer_from(amount=__registration_fee.get(), to=ctx.this,
        main_account=ctx.caller)
    __holdings[ctx.caller] = __registration_fee.get()
    __pending_registrations[ctx.caller] = True


@__export('masternodes')
def unregister():
    assert ctx.caller not in __nodes.get(
        ), "If you're a node already, you can't unregister. You need to leave or be removed."
    assert __pending_registrations[ctx.caller
        ] == True, 'No pending registration'
    if __holdings[ctx.caller] > 0:
        currency.transfer(__holdings[ctx.caller], ctx.caller)
    __pending_registrations[ctx.caller] = False
    __holdings[ctx.caller] = 0


